import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'angular-tutorial';
  name = 'Ariadne';
  age = 22;
  profilePic = 'https://avatars.githubusercontent.com/u/42656298?v=4';
  randomPic = 'https://source.unsplash.com/random'
}
<h1>Hello my name is {{name}} and I'm {{age}} yo.</h1>

This is my current profile pic
<img src={{profilePic}} alt="Profile picture">

Also this is a random image
<img src={{randomPic}} alt="Random Image">
